import React, { useState } from "react";
import { useLocation } from "react-router-dom";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import CssBaseline from "@mui/material/CssBaseline";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import Link from "@mui/material/Link";
import Checkbox from "@mui/material/Checkbox";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormControl from "@mui/material/FormControl";
// import NewOrderItemForm from "./NewOrderItemForm";

function Copyright(props) {
  return (
    <Typography
      variant="body2"
      color="text.secondary"
      align="center"
      {...props}
    >
      {"Copyright Â© "}
      <Link color="inherit" href="https://mui.com/">
        Pantry
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

function NewOrderForm(props) {
  const location = useLocation();
  const food = props.food;
  const order = location.state.params;
  // let date = order.date.toString().slice(0, 10);
  // console.log(date);

  const intitalState = {
    blackBeans: false,
    cereal: false,
    chickPeas: false,
    chicken: false,
    // "chickenFort": false,
    // "chili": 	false,
    // "cookies":	false,
    // "corn":false,
    // "fruit":	false,
    // "greenBeans"	: false,
    // "hash": 	false,
    // "jello": false,
    // "jelly":	false,
    // "macCheese": false,
    // "mayo": false,
    milk: false,
    pasta: false,
    pastaSauce: false,
    // "peanutButter": false,
    // "peas": false,
    // "porkBeans":	false,
    // "redBeans"; false,
    // "saltines" :false,
    soup: false,
    // "stew": false,
    // "tuna": false,
    // "whiteRice" : false
  };

  // const [formData, setFormData] = useState(initialState);
  const [formErrors, setFormErrors] = useState([]);
  const [checked, setChecked] = useState(intitalState);

  const {
    blackBeans,
    cereal,
    chickPeas,
    chicken,
    milk,
    pasta,
    pastaSauce,
    soup,
  } = checked;

  const pantryTheme = createTheme();

  const handleChange = (event) => {
    setChecked({
      ...checked,
      [event.target.name]: event.target.checked,
    });
  };

  return (
    <ThemeProvider theme={pantryTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}>
            <span className="material-symbols-outlined">nutrition</span>
          </Avatar>
          <Typography component="h1" variant="h5" sx={{ textAlign: "center" }}>
            Pantry Menu
          </Typography>
          <Typography component="h2" sx={{ textAlign: "center" }}>
            {/* {date} */}
          </Typography>
          <Typography component="h3" sx={{ textAlign: "center" }}>
            Clients can choose up to 12 items. Limit of 2 per item, except where
            noted.
          </Typography>
          <Box
            component="form"
            // onSubmit={handleSubmit}
            noValidate
            sx={{ display: "flex", mt: 1 }}
          >
            <FormControl sx={{ m: 3 }} component="fieldset" variant="standard">
              <FormControlLabel
                control={
                  <Checkbox
                    checked={chicken}
                    id="chicken"
                    name="chicken"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Chicken"
              />
              <FormControlLabel
                control={
                  <Checkbox
                    checked={chickPeas}
                    id="chickPeas"
                    name="chickPeas"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Chick Peas"
              />
              <FormControlLabel
                control={
                  <Checkbox
                    checked={cereal}
                    id="cereal"
                    name="cereal"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Cereal"
              />

              <FormControlLabel
                control={
                  <Checkbox
                    checked={milk}
                    id="milk"
                    name="milk"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Milk"
              />
              <FormControlLabel
                control={
                  <Checkbox
                    checked={pastaSauce}
                    id="pastaSauce"
                    name="pastaSauce"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Pasta Sauce or Crushed Tomatoes"
              />
              <FormControlLabel
                control={
                  <Checkbox
                    checked={pasta}
                    id="pasta"
                    name="pasta"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Pasta or Spaghetti"
              />

              <FormControlLabel
                control={
                  <Checkbox
                    checked={soup}
                    id="soup"
                    name="soup"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Soup"
              />

              <FormControlLabel
                control={
                  <Checkbox
                    checked={chickPeas}
                    id="chickPeas"
                    name="chickPeas"
                    onChange={handleChange}
                    // value={formData.firstName}
                  />
                }
                label="Chick Peas"
              />

              <Button fullWidth variant="contained" sx={{ mt: 3, mb: 2 }}>
                Submit
              </Button>
            </FormControl>
          </Box>
        </Box>
        <Copyright sx={{ mt: 8, mb: 4 }} />
      </Container>
    </ThemeProvider>
  );
}

export default NewOrderForm;
